package Revision;

public class Break_and_contiue {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
        
		for(int j=0; j<=3;j++) {
			
			for(int i=0; i<10;i++) {
				
				if(i==3) {
					break;
				}
				System.out.println(i);
			}
			System.out.println();
		}
		
	}

}
